package br.poli.ecomp.geav.nhe.model.db.act;import br.poli.ecomp.geav.nhe.model.db.Table;import br.poli.ecomp.geav.nhe.model.db.atp.IActionType;import br.poli.ecomp.geav.nhe.model.db.cmp.IComposition;import br.poli.ecomp.geav.nhe.model.db.ptc.IParticipation;	public class Action extends Table implements IAction{	private int act_identificador;	private IParticipation ptc_identificador;	private IActionType atp_identificador;	private IAction act_parent;	private IComposition cmp_identificador;	private String act_date_current;		public Action()	{	}	@Override	public String get_act_date_current() {		return this.act_date_current;	}	@Override	public int get_act_identificador() {		return this.act_identificador;	}	@Override	public IAction get_act_parent() {		return this.act_parent;	}	@Override	public IComposition get_cmp_identificador() {		return this.cmp_identificador;	}	@Override	public IParticipation get_ptc_identificador() {		return this.ptc_identificador;	}	@Override	public IActionType get_atp_identificador() {		return this.atp_identificador;	}	@Override	public void set_act_date_current(String value) {		this.act_date_current = value;	}	@Override	public void set_act_identificador(int value) {		this.act_identificador = value;	}	@Override	public void set_act_parent(IAction value) {		this.act_parent = value;	}	@Override	public void set_cmp_identificador(IComposition value) {		this.cmp_identificador = value;	}	@Override	public void set_ptc_identificador(IParticipation value) {		this.ptc_identificador = value;	}	@Override	public void set_atp_identificador(IActionType value) {		this.atp_identificador = value;	}	}
